(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-77c8f53a"],{"20c8":function(e,a,t){"use strict";t.r(a);var n=function(){var e=this,a=e.$createElement,t=e._self._c||a;return t("div",{staticClass:"cv-con",attrs:{id:"print-vis-on"}},[t("h1",{staticClass:"main"},[e._v("Hamish Clulee")]),t("h2",[e._v("BSc, Software Engineering, University of Otago")]),t("h3",[e._v("References upon request")]),t("h5",[e._v("hamish.clulee@gmail.com")]),t("h6",[e._v("Digital Nomad, primarily located in Asia.")]),t("h6",[e._v("New Zealand Citizen.")]),t("div",{staticClass:"fin-con"},[e._v("~")]),e._m(0),t("div",{staticClass:"fin-con"},[e._v("~")]),e._l(e.jobs,function(a,n){return t("div",{key:n,staticClass:"job-con"},[t("h2",[e._v(e._s(a.employer))]),t("h3",[e._v(e._s(a.title))]),t("h5",[e._v(e._s(a.dates))]),a.references?t("h6",{staticClass:"refs"},[e._v("References available")]):e._e(),e._l(a.description,function(a,n){return t("p",{key:n,domProps:{innerHTML:e._s(a)}})}),t("div",{staticClass:"fin-con"},[e._v("~")])],2)})],2)},s=[function(){var e=this,a=e.$createElement,t=e._self._c||a;return t("div",{staticClass:"key-con"},[t("h6",{staticClass:"exp-head"},[e._v("Commercial Environments & Production Web Applications")]),t("p",[t("em",[e._v("VueJs")]),e._v(" - 3+ years")]),t("p",[e._v("Javascript - 4+ years")]),t("p",[e._v("Java - 4+ years")]),t("p",[e._v("SASS/SCSS/CSS 4+ years")]),t("p",[e._v("NodeJs - 2+ years")]),t("p",[e._v("Linux - 4+ years")]),t("h6",{staticClass:"exp-head"},[e._v("Other relevant skills")]),t("p",[e._v("Working Remote - 3+ years")]),t("p",[e._v("Web Development - 5+ years")]),t("p",[e._v("Gimp/Inkscape (linux graphics and images editors) - 5+ years")])])}],i=(t("cadf"),t("551c"),t("097d"),{name:"cv",data:function(){return{jobs:[{title:"Full Stack Web Developer",employer:"Freelancing",dates:"April 2015 - Present (4+ years)",description:["Since early 2015 I have taken on a number of freelance web dev jobs, both while working \n                            in waged positions and as a full time freelancer.","Breif summary of works:","<ul>",'<li>Scratch build a booking, payment and calendar management app for @RONIN, \n                            a company that provides co-working and co-living spaces for digital nomads. \n                            Currently under developement. Details on the <a href="/work">projects page</a>.</li>','<li>Scratch build a booking, payment and staff allocation app for BabyAidNZ, an \n                            education outfit in New Zealand. Details on the <a href="/work">projects page</a>.</li>',"<li>A growing number of static websites/brochurewear sites, built using Vue and Sass and self \n                            hosted on DigitalOcean.</li>","</ul>","~","Almost everything I do while freelancing finds a way to make use of <em>VueJs</em> in some way, \n                            shape or form."],references:!0},{title:"Senior Frontend Developer",employer:"Netograph",dates:"August 2018 - August 2019 (1 year 1 month)",description:['Netograph provides a web app and an API service, their frontend is written in <em>VueJs</em> \n                            and Typescript, backed by a custom webpack configuration. Visualisations are written in \n                            d3.js. I was responsible for the vast majority of the frontend code currently hosted at \n                            <a href="https://netograph.io" target="_blank">https://netpgraph.io</a>',"Netograph's product is data. That data is gathered by a web crawler. Beginning by crawling \n                            open social media platforms like Twitter and 4chan each crawler thread follows any links \n                            encountered. When the crawler thread encounters a new domain it uses a headless browser to \n                            record all the worthwhile information and sends it back to the Netograph servers, then starts \n                            a new crawl. At the time I left there were over 2000 threads, which performed a capture in \n                            around 2 minutes and were constantly running. Netograph has a lot of data, 19 billion http \n                            request pairs captured at last count!",'Things that are indivually worth mentiong are, the \n                            <a href="https://netograph.io/datasets/social/" target="_blank">infinite scroll library</a>,\n                            which had to act in place of pagination due to how the lists being diaplyed are indexed.  \n                            Custom <a href="https://netograph.io/datasets/social/domain/facebook.com" target="_blank">masonary cards</a> \n                            , designed to show the user a smaple of the data in each list, remembering that each list could \n                            contain over a million items, and each first class object (IPs, domains, superdomains) could contain \n                            up to over 10 lists. A <a href="https://netograph.io/datasets/social" target="_blank">search component</a>, \n                            letting users find needles in a gigantic haystack, in a manner that was quick and easy.','Netograph also captures privacy and cookie policy pages.\n                            Each capture displays the text from the captured site, overlayed in the original \n                            position of a full page screenshot of the page being captured.  The has been captured by a headless chrominium browser, \n                            well before the painting and rendering stage. The advantage here is that the text has been extracted and is now \n                            parsable by Netograph servers, think GDPR and regulatory compliance for privacy enforcement. \n                            The UI was designed as a sales tool to show the accuracy of the data that is being captured.\n                            It\'s worth <a href="https://netograph.io/datasets/social/recentpolicies" target="_blank">checking out</a>.',"Overall, this was an awesome developement experience.",'<span class="remote">This was a 100% remote position</span>'],references:!0},{title:"Contract Frontend Developer",employer:"Allow Design",dates:"Intermittent between January 2017 - February 2019 (Contracts totalling 9+ months)",description:["Allow Design was a studio based in Dunedin, New Zealand. They had one primary client, \n                            a US healthcare giant. They would create functioning mini applications as design \n                            templates for developers working directly for healthcare firm. I was employed on \n                            and off for a number of these prototypes, I would create mini-web-apps from a \n                            Photoshop file provided by a Allow designer. I was also responsible for overhauling \n                            the frontend tooling and build system, to enact a <em>VueJs</em> and Webpack boilerplate, \n                            which was in usage until the company folded early this year.",'<span class="remote">This was a 100% remote position</span>'],references:!1},{title:"Software Developer",employer:"Fusion Sport Inc.",dates:"October 2017 - April 2018 (7 months)",description:["Fusion is a sports science company, based in Brisbane, Australia. They sell hardware products \n                            and provide a web app, both designed to \n                            provide athletes and sports teams with competitive advantages.","Please note that Fusion Sport accuired Profiler Corp, where I was working \n                            at the time, details of my work at Profiler can be found below.",'The Fusion Sport Client list is impressive, you can check it out \n                            <a href="https://www.fusionsport.com/clients/" target="_blank>here</a>, \n                            working directly for internationally recognisable sports teams was a real buzz.','My main focus was Smartabase; Fusion\'s primary web product. Smartbase functions on a \n                            "data-in-insights-out" model. Most of my time at Fusion was spent on the "...insights-out" \n                            part of their business, I wrote software that generated charts and tables from the data \n                            provided by the customer. I rebuilt frontend tooling, to replace Gulp and JQuery with a \n                            custom Webpack and <em>VueJs</em> boilerplate. The new boilerplate reduced lead time \n                            by a significant amount, the new tooling setup was heralded as very large success and \n                            is still in usage today.',"While most of my time at Fusion was spent using <em>Vue</em> to build dashboards, I \n                            was also responsible for providing all the API support to the \n                            frontend team, which required me to spend time wrting Java and Shell scripts, and still\n                            sequestered to write and debug Java on regularar basis. ",'A noteable highlight; after identifying a large number of elements being commonly requested by\n                            customers in their dashboard specifications, I proposed that we write an app to allow \n                            customers to use those elements \n                            without the need to directly employ developers. I was granted leadership of the Dashboard Builder Project. \n                            Details on the <a href="/work">projects page</a>. The Dashboard Builder was a big success \n                            and based on feedback from collegaues still working at Fusion, appears to be a customer favorite.','<span class="remote">This was a 100% remote position</span>'],references:!0},{title:"Web Application Developer",employer:"Profiler Corporation",dates:"August 2016 - October 2017 (1 year 3 months)",description:["This was a graduate position which I was offered in the second half of \n                        my third year at the University of Otago.","Profiler is sports science company based in Dunedin, New Zealand. Profiler was \n                            responsible for the creation of Smartabase, a web application built to assist \n                            with athlete and sport team management. The app had two main areas of focus. \n                            First, data in, users were able to create very detailed custom forms. Second, \n                            insights out, which was where I was orginally assigned due to my ReactJs \n                            experience and passion for UI design and build. The first few months were spent \n                            prototyping and designing a new UI for some of the 'insights out' parts of the app.\n                            Pivots occured and my focus shifted to be more backend focused, writing Java, \n                            providing API endpoints, debugging and refactoring.","Nearer\n                            the end of my time in this position my focus shifted back to being far more frontend\n                            focused, with a lot of my time spent writing <em>VueJS</em> and beginning to increase its\n                            usage throughout the code base.","Profiler Corp was acquired by Fusion, which meant a new position, details are above.",'<span class="remote">This was a 100% remote position</span>'],references:!0}]}}}),o=i,r=(t("8684"),t("2877")),l=Object(r["a"])(o,n,s,!1,null,"51b131b9",null);l.options.__file="cv.vue";a["default"]=l.exports},8684:function(e,a,t){"use strict";var n=t("c0f7"),s=t.n(n);s.a},c0f7:function(e,a,t){}}]);
